import React from "react";
import Navbar from "./components/elements/Navbar";
import "./App.css";
import Home from "./components/pages/Home";
import { BrowserRouter as Router, Switch, Route, Redirect } from "react-router-dom";
import LoggedInNav from "./components/elements/LoggedInNav"; 
import Recipes from "./components/pages/Recipes";
import Categories from "./components/pages/Categories";
import SignUp from "./components/pages/SignUp";
import Login from "./components/pages/Login";
import LoggedIn from "./components/pages/LoggedIn";
import ListRecipes from "./components/pages/ListRecipes";
function App() {
  return (
    <>
      <Router>
        
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/recipes" component={Recipes} />
          <Route path="/recipes/ListRecipes" component={ListRecipes} />
          <Route path="/categories" component={Categories} />
          <Route path="/login" component={Login} />
          <Route path="/sign-up" component={SignUp} />
          <Route path="/LoggedInNav" component={LoggedInNav} />
          <Route path="/LoggedIn" component={LoggedIn} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
